def predict(self, datapoint):
    ibocr = datapoint.get_ibocr()
    best_match = u'other'
    try:
      path = ibocr[0].get('document_path', '')
      file_name = path.rsplit('/', 1)[-1]
      if 'bol' in file_name.lower():
        best_match = u'BOL'
      elif 'inv' in file_name.lower():
        best_match = u'INV'
      elif 'draft' in file_name.lower():
        best_match = u'DFT'
      elif 'ccl' in file_name.lower():
        best_match = u'CCL'
      else:
        best_match = u'{}'.format(file_name)
    except Exception as e:
      best_match = u'{}'.format(ibocr)

    return ReceiptPrediction(best_match), None
